var vid_holder = document.querySelector(".vid_holder");

for (let i = 0; i < 8; i++) {
  let vids = document.createElement("div");
  vids.className = "vids";
  vids.appendChild(vid_holder);  
}

const Home = () => {
    return(
      <>
      <div className="scroll_top">
        <div className="All">
          All
        </div>
      </div>

      <div className="vid_holder">

        <div className="vids">

        </div>
        
      </div>
      </>
    )

  };
  
  export default Home;
